import React from 'react';
import {Offcanvas} from "react-bootstrap";


const TabsPages = ({children}: any): JSX.Element => {


    return (
        <>
            <Offcanvas show={true}
                       backdrop={false}
                       scroll={true}
                       style={{
                           width: "100%",
                           height: 30,
                           position: "sticky",
                           background: "rgba(12, 10, 10, 1)",
                       }}
            >
                {children}
            </Offcanvas>
        </>
    );
};

export default TabsPages;
